// truncate :: String -> String
     const truncate = R.when(
       R.propSatisfies(R.gt(R.__, 10), 'length'),
       R.pipe(R.take(10), R.append(''), R.join(''))
     );
     truncate('12345');         //=> '12345'
     truncate('0123456789ABC'); //=> '0123456789'

// pred :: Object -> Boolean
     const pred = R.where({
       a: R.equals('foo'),
       b: R.complement(R.equals('bar')),
       x: R.gt(R.__, 10),
       y: R.lt(R.__, 20)
     });

     pred({a: 'foo', b: 'xxx', x: 11, y: 19}); //=> true
     pred({a: 'xxx', b: 'xxx', x: 11, y: 19}); //=> false
     pred({a: 'foo', b: 'bar', x: 11, y: 19}); //=> false
     pred({a: 'foo', b: 'xxx', x: 10, y: 19}); //=> false
     pred({a: 'foo', b: 'xxx', x: 11, y: 20}); //=> false

// pred :: Object -> Boolean
     const pred = R.whereAny({
       a: R.equals('foo'),
       b: R.complement(R.equals('xxx')),
       x: R.gt(R.__, 10),
       y: R.lt(R.__, 20)
     });

     pred({a: 'foo', b: 'xxx', x: 8, y: 34}); //=> true
     pred({a: 'xxx', b: 'xxx', x: 9, y: 21}); //=> false
     pred({a: 'bar', b: 'xxx', x: 10, y: 20}); //=> false
     pred({a: 'foo', b: 'bar', x: 10, y: 20}); //=> true
     pred({a: 'foo', b: 'xxx', x: 11, y: 20}); //=> true

// pred :: Object -> Boolean
     const pred = R.whereEq({a: 1, b: 2});

     pred({a: 1});              //=> false
     pred({a: 1, b: 2});        //=> true
     pred({a: 1, b: 2, c: 3});  //=> true
     pred({a: 1, b: 1});        //=> false
